import React, {Component} from "react";
import BookCard from "./BookCard";

export default function BookCardLists({db}) {
    console.log();
    const {BookElements} = db.map(book => {
       return <BookCard bookItem={book} />
    })

    return (
        <div>
            {BookElements}
        </div>
    );

}
